column8:
イリジウムIXプラグは、一般プラグに比べ燃焼の広がりが速く、また絶縁体先端部にサーモエッジを設けて、プラグ汚損を改良した高性能プラグです。イリジウムプラグに交換すると加速力がアップします。アクセルに対してクイックな反応で、一般プラグとの違いを体感いただけます。 <br><br>イリジウムは新素材の合金。一般プラグに使われている白金などに比べ、融点、硬度、強度に優れた最高の電極素材です。電極が細く、火花が飛びやすいためエネルギーが大きく着火性がアップ。エンジンの性能を最大限に引き出します。<br><br>プラグ品番：BPR6HIX  本数：4本 <br><br>対応車種：83/6～ シトロエン CX2400 パラス (型式：E-MAMT  排気量：2300cc) <br><br>車検対応品<br><br>点火系/プラグ<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


